-- ----------------------------
--  Table structure for `actives_users`
-- ----------------------------
DROP TABLE IF EXISTS `actives_users`;
CREATE TABLE `actives_users` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `active_id` varchar(255) DEFAULT NULL COMMENT '活动全局唯一id',
  `order_id` varchar(255) DEFAULT NULL COMMENT '订单全局唯一id',
  `conducts` varchar(50) DEFAULT NULL COMMENT '联系人',
  `telphone` varchar(50) DEFAULT NULL COMMENT '联系电话',
  `created_id` varchar(255) DEFAULT NULL,
  `updated_id` varchar(255) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `status` tinyint(1) DEFAULT NULL COMMENT '状态：1正常 0删除 ',
  `use_num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '使用数量',
  `code` varchar(255) DEFAULT NULL COMMENT '验票码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=39 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='活动报名表';

