  `status` tinyint(1) DEFAULT NULL COMMENT '用户状态 0删除 1正常 2注销 3禁用 4待审核 5 驳回',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `balance` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '账户余额',
  `disable_id` varchar(255) DEFAULT NULL COMMENT '禁用类型全局ID-禁用类别',
  PRIMARY KEY (`id`),
  KEY `admin_users_email_unique` (`email`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=64 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='后台用户表';

