-- ----------------------------
--  Table structure for `answers`
-- ----------------------------
DROP TABLE IF EXISTS `answers`;
CREATE TABLE `answers` (
  `id` int(255) unsigned NOT NULL AUTO_INCREMENT,
  `answer_id` varchar(255) DEFAULT NULL COMMENT '回答全局唯一id',
  `source_id` varchar(255) DEFAULT NULL COMMENT '来源全局唯一id（文章，视频，问题，商家订单等）',
  `content` text COMMENT '回答内容',
  `like_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '点赞数',
  `comment_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '评论数目',
  `created_id` varchar(255) DEFAULT NULL COMMENT '发布者id',
  `updated_id` varchar(255) DEFAULT NULL COMMENT '编辑者id',
  `attachment` json DEFAULT NULL COMMENT '附件或者图片',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT NULL,
  `status` tinyint(1) DEFAULT NULL COMMENT '状态：1正常 0删除 2待审核 3审核未通过 4下架',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '类型：1文章 2视频 3问题 4商家订单 6服务 7淘货...',
  `score` smallint(4) unsigned NOT NULL DEFAULT '0' COMMENT '评分',
  `review` varchar(255) DEFAULT NULL COMMENT '审核信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=162 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='回答表';

