1a201d15720', null, null, '0', '0', '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, null, '2018-10-29 09:12:59', null, '1', '1', '0', null), ('138', '480efc8e-d4d4-41cd-91c3-81a15f4dd8b6', '21393243-eb18-45e3-a422-d7e3762bb9df', '<p>将小说不同世界观串联起来的，个人观点哈，是有关在人生各种逆境中人性的思考。（这里只讨论到绝剑篇。UW未完成且有争议，故不在这里讨论。）</p><p>SAO中，面对的是死亡的压力和失去约束的规则。许多人选择的是自暴自弃，干脆想做什么就做什么，错的不是我，而是世界（啊咧不对错的是GM）。在第一层什么都不敢做的捡果人、欺负弱小的军队、滥杀无辜的微笑棺木、杀死爱人的格里姆洛克都是在重压下的扭曲人性。或许换做很多现实中的人，想法也会像罗莎里奥说的：不就是个游戏，那么认真有个屁用。桐人强大的原因，并不只是因为他的等级、反应速度，而是对于这个死亡游戏的认真，就算只是虚拟的世界，没有规则的束缚，也应该保持责任感、正义感，也应该关心周围人的感情，也应该尽自己所能帮助别人。幸、西莉卡、莉兹、亚丝娜喜欢上桐人的原因，也是因为这份认真与温柔。就像桐人在房间里对西莉卡说的：等级终究只是一个数字而已，这个世界上有着我们真正应该重视的东西。</p>', '0', '2', '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, null, '2018-11-05 06:46:28', null, '1', '2', '0', null), ('139', 'f5eeea2d-dcb2-414c-994a-533b48e0d2d8', '21393243-eb18-45e3-a422-d7e3762bb9df', '<p>将小说不同世界观串联起来的，个人观点哈，是有关在人生各种逆境中人性的思考。（这里只讨论到绝剑篇。UW未完成且有争议，故不在这里讨论。）</p><p>SAO中，面对的是死亡的压力和失去约束的规则。许多人选择的是自暴自弃，干脆想做什么就做什么，错的不是我，而是世界（啊咧不对错的是GM）。在第一层什么都不敢做的捡果人、欺负弱小的军队、滥杀无辜的微笑棺木、杀死爱人的格里姆洛克都是在重压下的扭曲人性。或许换做很多现实中的人，想法也会像罗莎里奥说的：不就是个游戏，那么认真有个屁用。桐人强大的原因，并不只是因为他的等级、反应速度，而是对于这个死亡游戏的认真，就算只是虚拟的世界，没有规则的束缚，也应该保持责任感、正义感，也应该关心周围人的感情，也应该尽自己所能帮助别人。幸、西莉卡、莉兹、亚丝娜喜欢上桐人的原因，也是因为这份认真与温柔。就像桐人在房间里对西莉卡说的：等级终究只是一个数字而已，这个世界上有着我们真正应该重视的东西。</p>', '0', '0', '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, null, '2018-11-05 06:48:04', null, '1', '2', '0', null), ('140', 'f0e5d115-50b2-45eb-a31e-4b9b83423b66', '21393243-eb18-45e3-a422-d7e3762bb9df', '<p>我就只会说一句真好看</p>', '1', '0', '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, null, '2018-11-05 05:48:39', null, '1', '2', '0', null), ('141', 'sdfsfssdf-213ssf3-sdfss', '9cbf699e-afaa-40f4-9f38-089db582d185', '多余的评论', '0', '0', '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, null, '2018-10-30 10:44:59', null, '1', '4', '0', null), ('142', '1fce5639-cc5e-41b9-be79-c32d3f8e625d', '3e79d520-b39b-412f-9219-1502d6a914ad', '要回答说的夙愿', '0', '0', 'c4c7d408-acc8-446e-a168-a849e9095ae6', null, '[{\"name\": \"728da9773912b31b794ecb378b