-- ----------------------------
--  Table structure for `articles`
-- ----------------------------
DROP TABLE IF EXISTS `articles`;
CREATE TABLE `articles` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `article_id` varchar(255) DEFAULT NULL COMMENT '文章全局唯一id',
  `image_path` varchar(255) DEFAULT NULL COMMENT '文章图片路径',
  `category_id` varchar(255) DEFAULT NULL COMMENT '类别id（无人机，汽车等）',
  `source` varchar(255) DEFAULT NULL COMMENT '来源（网易新闻等） --暂无使用',
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
  `profile` varchar(255) DEFAULT NULL COMMENT '文章简介',
  `content` text COMMENT '内容',
  `attachment` json DEFAULT NULL COMMENT '附件地址',
  `like_num` int(11) DEFAULT NULL COMMENT '点赞数',
  `comment_num` int(11) DEFAULT NULL COMMENT '评论数',
  `view_num` int(11) DEFAULT NULL COMMENT '浏览数',
  `relay_num` int(11) unsigned DEFAULT '0' COMMENT '转发量',
  `word_num` int(11) DEFAULT NULL COMMENT '文章字数',
  `created_id` varchar(255) DEFAULT NULL COMMENT '发布者id',
  `updated_id` varchar(255) DEFAULT NULL COMMENT '修改者id',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `status` tinyint(1) DEFAULT NULL COMMENT '状态：0 删除  1正常 2 待审核 3 未通过 4 置顶',
  `refuse` varchar(255) DEFAULT NULL COMMENT '驳回信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=46 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='文章表';

