39008-7535-4068-9432-a21144d40d83', '哈哈我是一级标题', '0', '1', null, '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-26 15:52:08', null, '0'), ('46', '949809ce-25f7-4ebe-9e50-e2a977a30049', 'c2bb8718-702d-4f72-8e7b-6c56ad52d783', '我是二级标题', 'd1039008-7535-4068-9432-a21144d40d83', '2', '<p>不知道说甚！</p>', '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-26 15:52:08', null, '0'), ('47', '949809ce-25f7-4ebe-9e50-e2a977a30049', '2479e063-1c0d-4baa-9161-5df85b0dbe57', '哈哈我是一级标题2', '0', '1', null, '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-26 15:52:08', null, '0'), ('48', '949809ce-25f7-4ebe-9e50-e2a977a30049', 'c132ab11-b0cc-43fb-8c94-82e658114855', '我是二级标题2', '2479e063-1c0d-4baa-9161-5df85b0dbe57', '2', '<p>打我</p>', '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-26 15:52:08', null, '0'), ('51', '7f10c55b-dbdc-494e-8194-2a58aa96f5da', 'e78d0bfe-6df2-4d60-a65a-3be1c08ac770', '一切的开始', '0', '1', null, '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-30 17:28:43', null, '0'), ('52', '7f10c55b-dbdc-494e-8194-2a58aa96f5da', 'dfecf9f5-ac69-48de-8410-09f41c666051', '开始', 'e78d0bfe-6df2-4d60-a65a-3be1c08ac770', '2', '<p>2022年，电子机械制造商“ARGUS”开发“NERvGear”装戴在头上的机器，能够控制人类的脑神经连接虚拟世界，于是人类终于实现了完全的虚拟实境。</p><p>身为VRMMORPG（虚拟大规模线上角色扮演游戏）《刀剑神域〈SAO〉》中的其中一名玩家：桐人和其他一万个玩家才刚登入享受此游戏之时，游戏中的管理员对大家宣布了一个令人惊恐的消息──</p><p>那就是，现在唯一要登出此游戏的方法只有将这个游戏破关，并且在这个游戏中GAME OVER的话，也就代表了现实世界中的“死亡”。</p><p>桐人只能在这混乱的情况下，比其他玩家更早一步接受这个事实，投入了看不见终点的战斗之中……</p>', '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-30 17:28:43', null, '0'), ('53', '7f10c55b-dbdc-494e-8194-2a58aa96f5da', 'b380e964-396e-4da8-8af1-336b39e59be6', '追寻', 'e78d0bfe-6df2-4d60-a65a-3be1c08ac770', '2', '<p><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">完全攻略前无法脱离的死亡战斗MMO“Sword Art Online刀剑神域”中，除了像主角桐人这种以抵达最上层为目标的“攻略组”，还有许多职业、想法各不相同的玩家存在。</span></p><p><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">她们在无法退出游戏的严苛状况下，仍充满朝气地生活着，欢笑并且哭泣，她们只是如此享受着“游戏”。“驯兽师”西莉卡、“冶炼商店”的女老板莉兹贝特、谜样小女孩结衣，以及让黑色剑士忘不了的少女·幸——</span></p>', '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-30 17:28:43', null, '0'), ('54', '7f10c55b-dbdc-494e-8194-2a58aa96f5da', 'd81114b7-4be7-4d7c-bce0-f8efb2af1549', '不列颠', 'e78d0bfe-6df2-4d60-a65a-3be1c08ac770', '2', '<p>故事承接的TV版动画第二季，一种崭新的虚拟现实装置“增强现实（AR）”，一款名为《序列之争》AR游戏也大行其道。</p><p>与VR借助设备产生虚拟感官不同，<strong>AR直接对现实中的场景进行增强</strong>，比如把白天熙熙攘攘的都市广场、街道天桥，渲染成奇诡凶险的上古角斗场，<strong>而玩家在完全清醒的状态下，直接动用物理躯体进行竞技。</strong></p><p>由于游戏中的跑动、跳跃、攻击和防御，都是在现实的物理环境下完成的，曾经在VR游戏如鱼得水的桐人，也一度遭遇困境，要通过体能特训才重攀巅峰。</p><p>与此同时，就像TV版一样，虚拟与现实从不是截然二分，游戏中的生死之战总要与现实危机息息相关。</p><p>《序列之争》中暗藏着悄然蔓延的邪恶秘隐，还得这一群少年勇士，抽丝剥茧，曝光阴谋，挽救横跨两界的浩劫。<strong>他们迎风战斗，他们浴火成长。</strong></p>', '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-30 17:28:43', null, '0'), ('55', '7f10c55b-dbdc-494e-8194-2a58aa96f5da', '5706349b-e0db-4377-bbdf-f4e36999c3ee', '那过目的你', '0', '1', null, '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-30 17:28:43', null, '0'), ('56', '7f10c55b-dbdc-494e-8194-2a58aa96f5da', 'cb9becc7-a26f-4c4f-a12a-c265e124b402', '羞涩', '5706349b-e0db-4377-bbdf-f4e36999c3ee', '2', '<p><span style=\"font-size: 14px; color: rgb(51, 51, 51);\">为了拯救尚未从SAO里归还的亚丝娜，桐人登录到可疑的网络游戏VRMMO“ALfheim Online”里。</span></p><p><span style=\"font-size: 14px; color: rgb(51, 51, 51);\">这款次世代飞行系游戏“ALO”里有着“魔法”概念，以及根据玩家的反应力与判断力来决定胜负的动作游戏要素，再加上能变成“妖精”在天空翱翔的“飞行系统”和不下于“SAO”的高性能，所以让许多玩家深深为之着迷。在游戏当中成为“守卫精灵”的桐人，拼命朝着亚丝娜被幽禁的所在地——同时也是所有玩家最终目标的“世界树”前进……</span></p><p><span style=\"font-size: 14px; color: rgb(51, 51, 51);\">在路途当中，桐人虽然因为“火之精灵”这个精灵种族的阴谋而陷入了九死一生的危机，但在得到“风之精灵”的少女莉法帮助以及导航妖精结衣的辅助之后，终于得以逃出生天。</span></p><p><span style=\"font-size: 14px; color: rgb(51, 51, 51);\">而桐人最后终于来到“世界树”的根部。但就在这个时候，莉法和桐人无意间知道了彼此的“秘密”……</span></p>', '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-30 17:28:43', null, '0'), ('57', '7f10c55b-dbdc-494e-8194-2a58aa96f5da', '77836434-8499-4ab4-810a-b799b579b295', '浪漫的下午', '5706349b-e0db-4377-bbdf-f4e36999c3ee', '2', '<p>分析一下故事不难发现，就像很多经典日漫一样，《刀剑神域》也带着浓浓的中二气息。正是这样的中二，让我们的心为之跃动。</p><p>这个故事里，几乎见不到成年人的出现。就算有，也是解说的活道具，或是操纵一切的幕后反派。主创非常卖力和称职地，从视觉上打造了一个<strong>专属于少年的舞台。</strong></p><p>川原砾创作之初，给桐人和亚丝娜设定的年龄是14和15岁，剧场版的故事发生在三四年之后，<strong>正是他们最美好的年纪。</strong></p><p>现实世界，他们只是一群平凡的少男少女。他们搭地铁，分享甜点和八卦，跟APP学做饭，在自动售卖机买饮料，在都市深夜的街头随意坐着，互相吐槽打趣，也认真聊着对未来的期许。</p><p>而当进入《序列之争》的领域，他们就化身无所畏惧的战士，挑战着接踵而来、强大无匹的猛兽强敌。他们超越了年龄的勇气和信念，每一次冲锋和砍杀，都那样让人振奋和着迷。</p><p>而打通了现实与虚拟的使命，让他们的拼杀，不再是虚拟王国争夺荣誉的纯粹游戏，上升为像真正的成年人一样，剿灭邪恶、拯救苍生的担当。</p>', '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-30 17:28:43', null, '0'), ('58', '7f10c55b-dbdc-494e-8194-2a58aa96f5da', '79ae4f68-921b-437a-a04f-b87ffa600855', '最后的一起', '5706349b-e0db-4377-bbdf-f4e36999c3ee', '2', '<p>前几天，我兴冲冲地赶到点映的影院时，发现里面已经坐满了人。</p><p>我参加过科幻电影专场，恐怖电影专场，文艺青年专场，这个那个明星粉丝的专场，还有媒体人、制作人的专场，但<strong>还是头一次，体验二次元粉丝专场。</strong></p><p>放眼望去，观众当中，有很多一望即知的宅男，也有超龄但怀着少女心的女白领，像我这样的伪粉，身处其中一度十分惶恐，生怕露馅。</p><p>但很快就不尴尬了，他们的眼中，都闪着热切真诚的光芒，一心只想跟电影发生关系。让这场点映，带上了某种朝圣的味道。</p><p>很长一段时间里，我都不会忘记这次观影经历。真正的二次元粉，是不会不交头接耳充专家，踢凳子接电话的，当然更不会带上聒噪的熊孩子。</p><p>全场唯一的声响，就是在每一个小笑点出现时，一阵颇有默契的轻笑。我已经记不清有多久，没有过这样彻底舒适不闹心的观影体验。</p>', '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-30 17:28:43', null, '0'), ('59', '7f10c55b-dbdc-494e-8194-2a58aa96f5da', '93ddc812-3c6c-46c5-b325-e183f663a9ed', '刀剑信仰', '0', '1', null, '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-30 17:28:43', null, '0'), ('60', '7f10c55b-dbdc-494e-8194-2a58aa96f5da', '584a1027-0d11-47ec-9359-3ae9d4ba52d4', 'VR', '93ddc812-3c6c-46c5-b325-e183f663a9ed', '2', '<p><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">桐人从禁忌的死亡战斗MMO“Sword Art Online刀剑神域”回到现实世界后，立刻前去寻找游戏时的伙伴，同时也是心仪对象的亚丝娜。</span></p><p><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">但是结城明日奈（亚丝娜）却还没从那个噩梦般的游戏里归还。</span></p><p><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">桐人也因此而陷入困惑与绝望当中。他唯一的线索是亚丝娜以“妖精”模样伫立在鸟笼里的奇异影像档。亚丝娜似乎是被困在一款高性能的VRMMO游戏“ALfheim Online”里面。</span></p><p><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">为了解救亚丝娜，桐人一头闯入这个有着无数妖精飞翔交错的“ALO”世界……!!</span></p>', '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-30 17:28:43', null, '0'), ('61', '7f10c55b-dbdc-494e-8194-2a58aa96f5da', 'a96bc672-3a5b-40fe-9d2b-698657570737', 'SAO', '93ddc812-3c6c-46c5-b325-e183f663a9ed', '2', '<p><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">为了拯救尚未从SAO里归还的亚丝娜，桐人登录到可疑的网络游戏VRMMO“ALfheim Online”里。</span></p><p><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">这款次世代飞行系游戏“ALO”里有着“魔法”概念，以及根据玩家的反应力与判断力来决定胜负的动作游戏要素，再加上能变成“妖精”在天空翱翔的“飞行系统”和不下于“SAO”的高性能，所以让许多玩家深深为之着迷。在游戏当中成为“守卫精灵”的桐人，拼命朝着亚丝娜被幽禁的所在地——同时也是所有玩家最终目标的“世界树”前进……</span></p><p><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">在路途当中，桐人虽然因为“火之精灵”这个精灵种族的阴谋而陷入了九死一生的危机，但在得到“风之精灵”的少女莉法帮助以及导航妖精结衣的辅助之后，终于得以逃出生天。</span></p><p><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">而桐人最后终于来到“世界树”的根部。但就在这个时候，莉法和桐人无意间知道了彼此的“秘密”……</span></p>', '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-30 17:28:43', null, '0'), ('62', '7f10c55b-dbdc-494e-8194-2a58aa96f5da', '91a83446-2f69-4059-84cf-374ec9c17b0e', 'ALO', '93ddc812-3c6c-46c5-b325-e183f663a9ed', '2', '<p><span style=\"font-size: 14px; color: rgb(51, 51, 51);\">“SAO”事件已经过去了一年。某一天，桐人接到了总务省“虚拟课”菊冈诚二郎的奇怪委托。那是突然发生在充斥枪械与钢铁的VRMMO“Gun Gale Online”里的“死枪”事件。被拿着漆黑之枪的迷之角色所击中的玩家，在现实世界里也会随之“死亡”……无法拒绝的桐人答应帮助调查，虽然对于“虚拟世界”对“现实世界”发生物理影响这件事感到怀疑，但他还是登录了“GGO”。桐人为了寻找关于“死枪”的线索而在不熟悉的游戏里徘徊，这是对他伸出援手的，是一名惯用大型步枪“黑卡蒂Ⅱ”的少女——诗乃。</span></p>', '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-30 17:28:43', null, '0'), ('63', 'aa72c303-bdda-4e34-968a-923c541f32bd', '6a7bcc81-4bad-4b59-88c4-dd54160886d3', '测试目录1', '0', '1', null, '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-31 09:17:53', null, '0'), ('64', 'aa72c303-bdda-4e34-968a-923c541f32bd', '80595b5b-1335-443d-a78a-98898964431b', '测试目录11', '6a7bcc81-4bad-4b59-88c4-dd54160886d3', '2', null, '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '2018-10-31 09:17:53', null, '0'), ('65', 'aa72c303-bdda-4e34-968a-923c541f32bd', '1f0a1f65-b5b7-444b-9290-1cc75c3eaca1', '测试目录12', '6a7bcc81-4bad-4b59-88c4-dd54160886d3', '2', null, '26881348-ea11-4bd3-bee6-9cc0f58774d9', null, '