  `status` tinyint(1) DEFAULT NULL COMMENT '状态：1正常 0删除',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '类型：0目录 1产品类型',
  `image` varchar(255) DEFAULT NULL COMMENT '图片路径',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='类别表';

