-- ----------------------------
--  Table structure for `company_orders`
-- ----------------------------
DROP TABLE IF EXISTS `company_orders`;
CREATE TABLE `company_orders` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` varchar(255) DEFAULT NULL COMMENT '订单全局唯一id',
  `order_pid` varchar(255) DEFAULT NULL COMMENT '订单父id',
  `order_no` varchar(255) DEFAULT NULL COMMENT '订单编号',
  `product_id` varchar(255) DEFAULT NULL COMMENT '订单关联产品表asin',
  `company_id` varchar(255) DEFAULT NULL COMMENT '订单关联用户uid',
  `price` decimal(10,2) DEFAULT NULL COMMENT '单价',
  `total_price` decimal(10,2) DEFAULT NULL COMMENT '总价',
  `quantity` int(11) DEFAULT NULL COMMENT '数量',
  `logistics_no` varchar(255) DEFAULT NULL COMMENT '物流编号',
  `address_id` varchar(255) DEFAULT NULL COMMENT '关联地址id',
  `status` tinyint(1) DEFAULT NULL COMMENT '状态 1未付款 2已付款未发货  4已发货未收货 5已收货 6 已打款 7失效',
  `is_comment` tinyint(1) DEFAULT NULL COMMENT '是否评价：1已评价 0未评价',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `created_id` varchar(255) NOT NULL COMMENT '买家全局uid',
  `type` smallint(1) unsigned NOT NULL DEFAULT '1' COMMENT '类型：1商品 2活动 3服务',
  `refund` tinyint(1) unsigned DEFAULT '0' COMMENT '退货退款状态：1已退款 0未退款',
  `refund_num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '退货数量',
  `merchant_no` varchar(255) DEFAULT NULL COMMENT '支付成功后的商户单号',
  `is_deleted` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '用户是否删除（0：否 1：是）',
  `carrier` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '承运人（快递公司）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='商家订单';

