-- ----------------------------
--  Table structure for `company_profile`
-- ----------------------------
DROP TABLE IF EXISTS `company_profile`;
CREATE TABLE `company_profile` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `company_id` varchar(255) DEFAULT NULL COMMENT '公司全局ID',
  `company_name` varchar(255) DEFAULT NULL COMMENT '公司名称-冗余',
  `register_logo` varchar(255) DEFAULT NULL COMMENT '注册商标',
  `license` varchar(50) DEFAULT NULL COMMENT '执照号',
  `legal_person` varchar(10) DEFAULT NULL COMMENT '法人',
  `legal_idcard` varchar(22) DEFAULT NULL COMMENT '法人身份证',
  `address_register` varchar(255) DEFAULT NULL COMMENT '注册地址',
  `address_manage` varchar(255) DEFAULT NULL COMMENT '经营地址',
  `duty` varchar(255) DEFAULT NULL COMMENT '公司税号',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `created_id` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='公司资料';

