  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `uid` varchar(255) DEFAULT NULL COMMENT '产品所属用户全局唯一id',
  `category_id` int(11) DEFAULT NULL COMMENT '产品分类id',
  `brand_id` varchar(255) DEFAULT NULL COMMENT '品牌全局唯一id',
  `asin` varchar(255) DEFAULT NULL COMMENT '产品编号',
  `stock` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '产品库存',
  `sell_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '卖出数量',
  `price` decimal(10,2) DEFAULT NULL COMMENT '单价',
  `title` varchar(255) DEFAULT NULL COMMENT '商品名称',
  `description` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '商品描述',
  `content` text,
  `show_picture` json DEFAULT NULL COMMENT '商品展示图片',
  `province` varchar(50) DEFAULT NULL COMMENT '省份',
  `view_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '浏览人数',
  `city` varchar(50) DEFAULT NULL COMMENT '市',
  `district` varchar(50) DEFAULT NULL COMMENT '区',
  `score` decimal(2,1) unsigned NOT NULL DEFAULT '0.0' COMMENT '评分',
  `created_id` varchar(255) DEFAULT NULL,
  `updated_id` varchar(255) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT NULL,
  `status` tinyint(1) unsigned NOT NULL DEFAULT '3' COMMENT '状态：1上架 2下架 0删除 3待审核 4未通过',
  `video` json DEFAULT NULL COMMENT '视频',
  `attachment` json DEFAULT NULL COMMENT '附件',
  `refuse` varchar(255) DEFAULT NULL COMMENT '驳回理由',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=39 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='淘货';

