DROP TABLE IF EXISTS `history_records`;
CREATE TABLE `history_records` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `uid` varchar(255) DEFAULT NULL COMMENT '活动记录关联用户uid',
  `record_id` varchar(255) DEFAULT NULL COMMENT '活动记录id，关联视频id和百科id',
  `type` tinyint(1) DEFAULT NULL COMMENT '类别：1文章2视频3问题4活动5商品6服务7百科',
  `record_time` bigint(13) unsigned DEFAULT NULL COMMENT '记录时间',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=828 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='用户历史记录';

