-- ----------------------------
--  Table structure for `user_orders`
-- ----------------------------
DROP TABLE IF EXISTS `user_orders`;
CREATE TABLE `user_orders` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` varchar(255) DEFAULT NULL COMMENT '订单全局唯一id',
  `order_pid` varchar(255) DEFAULT '' COMMENT '订单父id',
  `order_no` varchar(255) DEFAULT NULL COMMENT '订单编号',
  `product_id` varchar(255) DEFAULT NULL COMMENT '订单关联产品表asin',
  `uid` varchar(255) DEFAULT NULL COMMENT '订单关联用户uid(卖家)',
  `price` decimal(10,2) DEFAULT NULL COMMENT '单价',
  `total_price` decimal(10,2) DEFAULT NULL COMMENT '总价',
  `quantity` int(11) DEFAULT NULL COMMENT '数量',
  `logistics_no` varchar(255) DEFAULT NULL COMMENT '物流编号',
  `status` tinyint(1) DEFAULT NULL COMMENT '状态 1未付款 2已付款未发货  3已发货未收货 4已收货 5删除 6失效',
  `is_comment` tinyint(1) DEFAULT '0' COMMENT '是否评价：1已评价 0未评价',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT NULL,
  `address_id` varchar(255) DEFAULT NULL COMMENT '关联地址id',
  `created_id` varchar(255) NOT NULL COMMENT '买家全局uid',
  `merchant_no` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '商户单号',
  `is_deleted` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '用户是否删除',
  `carrier` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '承运人（快递公司）',
  `refund` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '退货退款状态：1已退款 0未退款',
  `refund_num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '退货数量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='商家订单';

