-- ----------------------------
--  Table structure for `users`
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '用户名',
  `tel` char(11) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '手机号码',
  `email` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '邮箱',
  `status` int(1) NOT NULL DEFAULT '0',
  `password` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '密码',
  `remember_token` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '记住我令牌',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `users_email_unique` (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='用户表';

-- ----------------------------
--  Table structure for `videos`
-- ----------------------------
DROP TABLE IF EXISTS `videos`;
CREATE TABLE `videos` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `video_id` varchar(255) DEFAULT NULL,
  `category_id` int(11) DEFAULT NULL COMMENT '视频分类id',
  `title` varchar(255) DEFAULT NULL COMMENT '视频标题',
  `description` text COMMENT '视频描述',
  `video_url` varchar(255) DEFAULT NULL COMMENT '视频地址',
  `view_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '观察次数',
  `like_num` int(11) DEFAULT '0' COMMENT '点赞数',
  `comment_num` int(11) DEFAULT NULL COMMENT '评论数',
  `is_course` tinyint(1) DEFAULT NULL COMMENT '是否为教程贴',
  `source` varchar(255) DEFAULT NULL COMMENT '来源',
  `attachment` json DEFAULT NULL COMMENT '附件地址',
  `cover` varchar(255) DEFAULT NULL COMMENT '视频封面图片url',
  `type` tinyint(1) NOT NULL COMMENT '1视频2服务3淘货4商品5活动',
  `created_id` varchar(255) DEFAULT NULL COMMENT '视频上传者id',
  `updated_id` varchar(255) DEFAULT NULL COMMENT '视频编辑者id',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT NULL,
  `status` int(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态：0 删除  1正常(通过) 2 待审核 3 未通过 4 已审核',
  `video_length` int(11) DEFAULT NULL COMMENT '视频长度',
  `refuse` varchar(255) DEFAULT NULL COMMENT '驳回信息',
  `relay_num` int(11) unsigned DEFAULT '0' COMMENT '转发量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='视频';

